    <a href="#" class="btn btn-primary">Go somewhere</a>
      </div>
  <img src={imag} class="card-img-top" alt="..."/>
  <div class="card-body">
    <h5 class="card-title">Card title</h5>
    <div className="bike">
    <a href="#" class="btn btn-primary">Go somewhere</a>
    <a href="#" class="btn btn-primary">Go somewhere</a>
    </div>

  </div>
</div>
  );
}

export default App;
